  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kulm Wetland
  Mangement District outlines Refuge accomplishments during the 1982 calendar year.
  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  research and investigations. Refuge administration is outlined; information about
  personnel, youth programs, manpower programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, croplands,
  grasslands, grazing, haying, fire management, pest control, and WPA easements. The
  wildlife section of the report discusses endangered and threatened species, waterfowl,
  marsh birds and waterbirds, raptors, game mammals, animal control, and disease control.
  The public uses of the Refuge described in this report include outdoor classrooms,
  interpretive programs, hunting, fishing, trapping, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, communication
  systems, and energy conservation. Items of interest are provided at the end.\",\n\t\"owner_org\":
